import React from 'react'

function Nav({setUsername, username}) {
  return (
    <div className="nav">
        <input type="text" className="search" value={username} 
        onChange={(e) => setUsername(e.target.value)}
        placeholder='Username' />
      </div>
  )
}

export default Nav
